import React, {Component} from 'react';
import { Input ,Button } from 'antd';


export default class MyInfo extends Component{
    constructor(props){
        super(props)
        this.state={
            name:'',
            desc:'',
            source:'',
            url:''
        }
        this.setName = this.setName.bind(this)
        this.setDesc = this.setDesc.bind(this)
        this.setUrl = this.setUrl.bind(this)
        this.setSource = this.setSource.bind(this)
        this.myclick = this.myclick.bind(this)


    }

    setName= (value) => {
        this.setState({name:value})
    }
    setDesc= (value) => {
        this.setState({desc:value})
    }
    setUrl= (value) => {
        this.setState({url:value})
    }
    setSource= (value) => {
        this.setState({source:value})
    }
    myclick=()=>{
        this.props.history.replace('/')

        const {
            name,
            desc,
            url,
            source
        } = this.state

        const data = {
            name, 
            desc,
            url,
            source
        }
        this.props.dispatch({type:'add',data})
    }
    render(){
        return(
            <div>
                <Input addonBefore="名称:" placeholder="default" style={{width:"30%",marginTop:"20px", marginLeft:"35%"}}  onChange={(e) => {setName(e.target.value)}}/>
                <br/>
                <Input addonBefore="描述:" placeholder="hello" style={{width:"30%",marginTop:"10px", marginLeft:"35%"}}  onChange={(e) => {setDesc(e.target.value)}}/>
                <br/>
                <Input addonBefore="网址:" placeholder="http://www.baidu.com" style={{width:"30%",marginTop:"10px", marginLeft:"35%"}}  onChange={(e) => {setUrl(e.target.value)}}/>
                <br/>
                <Input addonBefore="类型:" placeholder="hello" style={{width:"30%",marginTop:"10px", marginLeft:"35%"}}  onChange={(e) => {setSource(e.target.value)}}/>
                <br/>
                <Button onClick={myclick}  style={{marginTop:"20px", marginLeft:"10px",background:'#1890ff',color:'#fff',marginLeft:"35%"}}>提交</Button>
            </div>
        )
    }
}
